	-- VERY UGLY HACK
	-- Will this leak threads?
	-- Is the problem even what I think it is (player arrived before character)?
	while true do
		if newPlayer.Character ~= nil then break end
		wait(5)
	end

	local humanoid = newPlayer.Character.Humanoid

	humanoid.Died:connect(function() onHumanoidDied(humanoid, newPlayer) end )

	-- start to listen for new humanoid
	newPlayer.Changed:connect(function(property) onPlayerRespawn(property, newPlayer) end )


	stats.Parent = newPlayer

end

function Send_DB_Event_Died(victim, killer)
	-- killer may be nil
	local killername = "no one"
	if killer ~= nil then killername = killer.Name end
	print("DIED EVENT: ", victim.Name, " KILLED by ", killername)

	if shared["deaths"] ~= nil then 
		shared["deaths"](victim, killer)
		print("SENT DB DEATH EVENT")
	end
end

function Send_DB_Event_Kill(killer, victim)
	print("KILL EVENT. ", killer.Name, " BLOXXED ", victim.Name)
	if shared["kills"] ~= nil then 
		shared["kills"](killer, victim)
		print("SENT DB KILL EVENT")
	end
end

function dropWeapons(humanoid, player)
	local weapons = player.Backpack:GetChildren()

	local c = player.Character
	if c ~= nil then 
		local childs = c:GetChildren()
		for i = 1,#childs do
			weapons[#weapons] = childs[i] -- merge tools in character with tools in backpack
		end
	end

	for i=1,#weapons do
		if (weapons[i].className == "Tool" and weapons[i].Name ~= "Sword") then
			local w  = weapons[i]:clone()
			w.Handle.Position = humanoid.Parent.Torso.Position + Vector3.new(10 - math.random() *20, 30 + (i * 6), 5 -  math.random() * 10)
			w.Parent = game.Workspace
			
		end

		if (weapons[i].className == "HopperBin" and weapons[i].Name == "JetBoots") then
			local j = JetbootPickup:clone()
			j.Parent = game.Workspace
			j:MakeJoints()
			j:MoveTo(humanoid.Parent.Torso.Position + Vector3.new(math.random() - .5, 35, math.random() - .5))
		end
	end

	if c ~= nil then 
		local childs = c:GetChildren()
		for i = 1,#childs do
			if (childs[i].className == "Tool") then childs[i].Parent = nil end -- stops "double weapon drop"
		end
	end

	wait(.1)


end

function onHumanoidDied(humanoid, player)
	local stats = player:findFirstChild("leaderstats")
	if stats ~= nil then
		local deaths = stats:findFirstChild("Wipeouts")
		deaths.Value = deaths.Value + 1

		-- do short dance to try and find the killer

		local killer = getKillerOfHumanoidIfStillInGame(humanoid)


		Send_DB_Event_Died(player, killer)
		handleKillCount(humanoid, player)

		-- kill all messages under player
		local childs = player:GetChildren()
		for i=1,#childs do
			if (childs[i].className == "Message") then childs[i].Parent = nil end
		end

		dropWeapons(humanoid, player)
	end
end

function onPlayerRespawn(property, player)
	-- need to connect to new humanoid
	
	if property == "Character" and player.Character ~= nil then
		local humanoid = player.Character.Humanoid
			local p = player
			local h = humanoid
			humanoid.Died:connect(function() onHumanoidDied(h, p) end )
	end
end

function getKillerOfHumanoidIfStillInGame(humanoid)
	-- returns the player object that killed this humanoid
	-- returns nil if the killer is no longer in the game

	-- check for kill tag on humanoid - may be more than one - todo: deal with this
	local tag = humanoid:findFirstChild("creator")

	-- find player with name on tag
	if tag ~= nil then
		
		local killer = tag.Value
		if killer.Parent ~= nil then -- killer still in game
			return killer
		end
	end

	return nil
end

function handleKillCount(humanoid, player)
	local killer = getKillerOfHumanoidIfStillInGame(humanoid)
	if killer ~= nil then
		local stats = killer:findFirstChild("leaderstats")
		if stats ~= nil then
			local kills = stats:findFirstChild("KOs")
			if killer ~= player then
				kills.Value = kills.Value + 1
				
			else
				kills.Value = kills.Value - 1
				
			end
			Send_DB_Event_Kill(killer, player)
		end
	end
end

